import React from 'react';
import { GET_USER } from './api';

function App() {
  const [dados, setDados] = React.useState(null);

  React.useEffect(() => {
    const { url, options } = GET_USER();
    fetch(url, options)
      .then((response) => response.json())
      .then((json) => setDados(json));
  }, [dados]);

  return (
    <div>
      {dados.map((e) => (
        <p>{e.id}</p>
      ))}
    </div>
  );
}

export default App;
